import { Table } from 'antd';
import 'antd/dist/antd.css';
import React, { Component } from 'react';
import './index.css';

const columns = [
    { title: 'Server ID', dataIndex: 'serverID', key: 'serverIDt', render: (data) => <span>{data._text}</span> },
    { title: 'Server URL', dataIndex: 'serverUrl', key: 'serverUrl' },
    { title: 'Online', dataIndex: 'online', key: 'online' },
    { title: 'Load Multiplier', dataIndex: 'loadMultiplier', key: 'loadMultiplier' },
    { title: 'Enabled', dataIndex: 'enabled', key: 'enabled' },
    { title: 'Load', dataIndex: 'load', key: 'load' },
    {
        title: 'Action',
        dataIndex: '',
        key: 'x',
        render: () => <a onClick={() => console.log("delete")}>Enable</a>
    },
];

class AntdTable extends Component {
    render() {
        { console.log(this.props.children) }
        return (
            <Table
                columns={columns}
                expandable={{
                    expandedRowRender: record => <p style={{ margin: 0 }}>{record.serverID._text}</p>,
                    rowExpandable: record => record.name !== 'Not Expandable',
                }}
                dataSource={this.props.children}
            />
        )
    }
}

export default (AntdTable);
